unsigned int rr[2 * NUMBER_OF_POINTS + 1];
double logs[2 * NUMBER_OF_POINTS + 1];
int max_depth;
unsigned int depth_stats[NUMBER_OF_STATES + 1];

enum uct_node_state {NEW, FULLY_EXPANDED, SOLVED};

struct uct_node {
  unsigned int n;
  unsigned int sum_length;
  double log_sum_games;    
  unsigned int first_child;
  unsigned int next_sibling;
  enum uct_node_state state;
};

#define TREE_SIZE 10000000
struct uct_tree {
  unsigned int next_node;
  struct uct_node nodes[TREE_SIZE];
};

struct uct_tree global_tree;

unsigned int get_new_node(struct uct_tree *tree)
{
  struct uct_node *node = &tree->nodes[tree->next_node];
  node->n = 0;
  node->sum_length = 0;
  node->log_sum_games = 0;
  node->first_child = 0;
  node->next_sibling = 0;
  node->state = NEW;
  return tree->next_node++;
}

unsigned int random_choice(unsigned int n)
{
  unsigned int k;
  unsigned int r = rr[n];

  do {
    k = gg_urand();
  } while (k < r);

  return k % n;
}

double play_games(int state, int *visited_states, int depth,
		  struct uct_tree * tree, struct uct_node *node,
		  int *length)
{
  int k;
  int valid_next_states[2 * NUMBER_OF_POINTS];
  unsigned int number_valid_next_states = 0;
  double logsize = 0.0;
  double child_logsize;
  int next_state;
  struct uct_node *next_node = NULL;
  
  visited_states[state] = 1;
  for (k = 0; k < 2 * NUMBER_OF_POINTS; k++) {
    next_state = transformations[state][k];
    if (next_state < 0)
      break;
    if (!visited_states[next_state]) {
      valid_next_states[number_valid_next_states] = next_state;
      number_valid_next_states++;
    }
  }

  if (number_valid_next_states > 0) {
    if (!node || node->n == 0) {
      k = random_choice(number_valid_next_states);
      next_state = valid_next_states[k];
      next_node = NULL;
    }
    else {
      if (node->state == NEW) {
	int child_id = node->first_child;
	if (!child_id) {
	  node->first_child = get_new_node(tree);
	  next_state = valid_next_states[0];
	  next_node = &tree->nodes[node->first_child];
	  if (number_valid_next_states == 1)
	    node->state = FULLY_EXPANDED;
	}
	else {
	  int next_node_id;
	  for (k = 0; k < number_valid_next_states; k++) {
	    if (tree->nodes[child_id].next_sibling == 0)
	      break;
	    child_id = tree->nodes[child_id].next_sibling;
	  }
	  next_node_id = get_new_node(tree);
	  tree->nodes[child_id].next_sibling = next_node_id;
	  next_state = valid_next_states[k + 1];
	  next_node = &tree->nodes[next_node_id];
	  if (k + 2 == number_valid_next_states)
	    node->state = FULLY_EXPANDED;
	}
      }
      else if (node->state == FULLY_EXPANDED) {
	float best_uct_value = 0.0;
	int child_id = node->first_child;
	float p = (float) node->n;
	float q = 10 * sqrtf(2.0 * logf(p));
	for (k = 0; k < number_valid_next_states; k++) {
	  struct uct_node *child = &tree->nodes[child_id];
	  float n = (float) child->n;
	  float uct_value = child->sum_length / n + q / sqrtf(n);
	  if (uct_value > best_uct_value && child->state != SOLVED) {
	    best_uct_value = uct_value;
	    next_state = valid_next_states[k];
	    next_node = child;
	  }
	  child_id = child->next_sibling;
	}
	if (best_uct_value == 0.0) {
	  node->state = SOLVED;
	  next_state = 0;
	  next_node = NULL;
	  *length = depth;
	}
      }
    }
    
    if (next_state)
      child_logsize = play_games(next_state, visited_states, depth + 1,
				 tree, next_node, length);
    else
      child_logsize = 0;
    
    if (node) {
      node->n++;
      node->sum_length += *length;
    }

    logsize = child_logsize + logs[number_valid_next_states];
    logsize += log(1 + exp(-logsize));
  }
  else {
    if (depth > max_depth)
      max_depth = depth;
    *length = depth;
    depth_stats[depth]++;
  }
  
  visited_states[state] = 0;
  return logsize;
}

int main(int argc, char **argv)
{
  double logsize;
  int visited_states[NUMBER_OF_STATES];
  int k;
  int j;
  const int N = 10000000;
  double logsum = 0.0;
  int length;

  struct uct_tree *tree = &global_tree;

  gg_srand(6);
  
  for (k = 0; k < NUMBER_OF_STATES; k++)
    visited_states[k] = 0;

  for (k = 1; k <= 2 * NUMBER_OF_POINTS; k++) {
    rr[k] = ((0xffffffffU % k) + 1) % k;
    logs[k] = log((double) k);
  }

  tree->next_node = 0;
  get_new_node(tree);
  
  max_depth = 0;
  
  for (j = 0; j < N; j++) {
    logsize = play_games(0, visited_states, 1, tree, tree->nodes, &length);
    if (logsize < logsum)
      logsum += log(1 + exp(logsize - logsum));
    else
      logsum = logsize + log(1 + exp(logsum - logsize));
    
    if (j % 10000 == 9999)
      printf("%d %f (max_depth: %d)\n", j + 1,
	     (float) (logsum - log(j + 1)) / log(2), max_depth);
  }

  printf("Game length distribution:\n");
  for (k = 0; k <= max_depth; k++)
    if (depth_stats[k] > 0)
      printf("%5d: %7u\n", k, depth_stats[k]);
  
  printf("\nLogsize: %f, max_depth: %d\n", (float) (logsum - log(N)) / log(2),
	 max_depth);
  return 0;
}
